$(document).ready(function() {
    freqDic = freqDic.map(x => ({ key: x.split(' ')[1].toLowerCase(), value: x}));
    prons = new Map();
    freqDic.forEach(kv => {
        var p = (kv.value.match(/\[[^\d\]]+\]/) ?? [""])[0];
        p = p.replaceAll(/[\[\]]/g, "");
        if (p) prons.set(kv.key, p);
    });
    
    $("body").prepend(`
        <style>
            * { box-sizing: border-box; }
            .hidden { display: none; }
            .freq-dic-box { z-index: 1000; position: fixed; width: 100%; top: 0pt; background-color: #ffd; border-bottom: 1pt solid gray; font-size: 16pt; }
            .freq-dic-box p { margin: 8pt; }
            .freq-dic-box-items { width: 100%; }
            .freq-dic-box-close { width: 1pt; padding: 5pt 15pt; cursor: pointer; vertical-align: top; }
        </style>
        
        <div class="freq-dic-box hidden"></div>
    `);
});

function freqDicClick(q) {
    var fn = function (e) {
        var boldDic = function (s) {
            var w = s.match(/^\d+ ([^ ]+)/)[1];
            return s.replace(w, `<b>${w}</b>`);
        };
        
        $(".freq-dic-box").addClass("hidden");
        var s = window.getSelection();
        var r = s.getRangeAt(0);
        
        if (r.toString() !== "") return;
        
        var node = s.anchorNode;
        var max = node.textContent.length;
        
        while((/^[a-z]*$/i).test(r.toString()) && r.startOffset > 0) {
            r.setStart(node, (r.startOffset - 1));
        }
        
        while ((/^[^a-z]/i).test(r.toString())) {
            r.setStart(node, (r.startOffset + 1));
        }
        
        while((/^[a-z]*$/i).test(r.toString()) && r.endOffset < max) {
            r.setEnd(node, (r.endOffset + 1));
        }
        
        while ((/[^a-z]$/i).test(r.toString())) {
            r.setEnd(node, (r.endOffset - 1));
        }
        
        var w = r.toString().toLowerCase();
        if (!w) return;
        
        
        var ls = new Set(getLems(w));
        
        var r = freqDic.filter(x => ls.has(x.key)).map(x => "<p>" + boldDic(x.value) + "</p>").join("");
        
        if (!r) return;
        
        $(".freq-dic-box").html(`<table><tr><td class="freq-dic-box-items">${r}</td><td class="freq-dic-box-close">&#10006;</td></tr></table>`);
        $(".freq-dic-box").removeClass("hidden");
    };

    $(document).on("click", ".freq-dic-box-close", function () {
        $(".freq-dic-box").addClass("hidden");
    });
    
    if (q) {
        $(document).on("click", q, fn);
    }
    else {
        $(document).on("click", fn);
    }
}

